import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Home extends Component {
    constructor() {
        super()
        this.state = {
            latitude: 0,
            longitude: 0
        }

        this.onChange = (event) => {
            this.setState({
                latitude: event.target.value
            })
        }
    }

    render() {
        return (
            <div>
                <Link to={'/'}>Back</Link>
                <div>
                    <label>
                        Latitude: <input name='latitude' onChange={this.onChange} value={this.state.latitude} type='text' placeholder='Latitude'></input>
                    </label>
                    <h3>Texto digitado</h3>
                </div>
            </div>
        )
    }
}
